		[Test]
		public virtual void TestAddEntry()
		{
			var msg = RawFixUtil.GetFixMessage("".AsByteArray());
			RawFixUtil.IndexRepeatingGroup(msg, FixVersion.Fix43, "8", true);

			var group454 = msg.AddRepeatingGroupAtIndex(0, 454);
			var group555 = msg.AddRepeatingGroupAtIndex(1, 555);
			for (var i = 0; i < 33; i++)
			{
				var entry454 = group454.AddEntry();
				entry454.AddTag(455, i);
				entry454.AddTag(456, i);

				var entry555 = group555.AddEntry();
				entry555.AddTag(600, i);
				entry555.AddTag(601, i);
				var subGroup = entry555.AddRepeatingGroup(604);
				for (var j = 0; j < 33; j++)
				{
					var subEntry = subGroup.AddEntry();
					subEntry.AddTag(605, j);
					subEntry.AddTag(606, j);
				}
			}

			ClassicAssert.AreEqual(MsgForParse, msg.ToString());
			msg.ReleaseInstance();
		}

